import React, { memo } from "react";
import { formData } from './schema';

const GetFormElement = React.lazy(() => import('component/GetFormElement'));
const Button = React.lazy(() => import('component/Button'));
const Login = () => {
	console.log("Login render")
	return(
		<div className="background" style={{
			backgroundImage: `url(${process.env.PUBLIC_URL + '/static/media/bg_login.jpg'})`,
			backgroundPosition: "center",
			backgroundRepeat: "no-repeat",
			backgroundSize: "cover"
		}}>
			<div className="login-box card-shadow">
				<div className="content">
					<div style={{ display: "flex", justifyContent: "end", flexWrap: "nowrap", marginBottom: 50 }}>
						<div style={{ position: 'absolute', height: '140px', top: '10px', left: '-20px' }}>
							<img width={234} src={'static/media/prudential_logo_login.png'} alt="Logo" draggable={false} />
						</div>
						<div style={{ width: '300px' }}>
							<div style={{ fontSize: 22, textAlign: 'right', color: 'rgb(167, 168, 170)', fontFamily: 'FSAlbertPro-light' }}>Welcome To</div>
							<img width={300} src={'static/media/PRUMedicalNetwork Portal_Logo.png'} alt="Logo" draggable={false} />
						</div>
					</div>
					<div>
						{
							Object.keys(formData).map((form, formIndex) => {
								const currentDefaultField = formData[form];
								console.log(formData[form],'po')
								return(
									<GetFormElement
										key={formIndex}
										disable={currentDefaultField.disable}
										label={currentDefaultField.label}
										id={currentDefaultField.id}
										name={currentDefaultField.targetValue} // => path obj for store/save value
										placeholder={currentDefaultField.placeholder}
										type={currentDefaultField.type}
										// onChange={fields.handleChange}
										// onBlur={fields.handleBlur}
										value={currentDefaultField.value}
										required={currentDefaultField.required}
										validation={{
											isError: false,
											isTouched: false,
											message: ''
										}}
									/>
								)
							})
						}
						<Button type="submit" title={"LOGIN"} style={{ marginTop: 10, marginBottom: 25 }}/>
					</div>
				</div>
			</div>
		</div>
	)
}

export default memo(Login, (prevProps, nextProps) => {
	return JSON.stringify(prevProps) === JSON.stringify(nextProps);
})
